import React from "react";
// import InputMask from "react-input-mask";
// import {
//     BrowserRouter as Link
// } from "react-router-dom";
import "./App.css";
import Form from "react-bootstrap/Form";
import { Col } from "react-bootstrap";
// import FormControl from "react-bootstrap/FormControl";
// import FormCheck from "react-bootstrap/FormCheck";
import Button from "react-bootstrap/button";
// fetch("/api/signup", {
//   method: "POST",
//   body:
//     "'username', 'password', 'name', 'occupation', 'address', 'phoneNumber', 'email'"
// });

export default function SignUp() {
  return (
    <div class="login-header">
      <Form>
        <Form.Group controlId="occupation">
          <Form.Label>Occupation:</Form.Label>
          <Form.Control placeholder="Company or school" required />
        </Form.Group>
        <Form.Row>
          <Form.Group controlId="full_name">
            <Form.Label>Full Name:</Form.Label>
            <Form.Control placeholder="John Smith" required />
          </Form.Group>
          <Form.Group controlId="phone">
            <Form.Label>Phone:</Form.Label>
            <Form.Control placeholder="(123) 456-7890" required />
          </Form.Group>
        </Form.Row>
        <Form.Group controlId="email">
          <Form.Label>Email:</Form.Label>
          <Form.Control
            type="email"
            placeholder="john.smith@email.com"
            required
          />
        </Form.Group>
        <Form.Row>
          <Form.Group as={Col} controlId="username">
            <Form.Label>Username:</Form.Label>
            <Form.Control type="username" placeholder="New username" required />
          </Form.Group>

          <Form.Group as={Col} controlId="password">
            <Form.Label>Password:</Form.Label>
            <Form.Control type="password" placeholder="New password" required />
          </Form.Group>
        </Form.Row>

        <Form.Group controlId="address">
          <Form.Label>Address:</Form.Label>
          <Form.Control placeholder="1234 Main St" required />
        </Form.Group>

        <Button variant="secondary" type="submit">
          Sign Up
        </Button>
      </Form>
    </div>
    // <div class="login-header">
    //   <h2>Sign Up</h2>
    //   <form onSubmit="fetch">
    //     <label for="username">Username:{"  "}</label>
    //     <input id="login-box" type="username" name="username" required></input>
    //     <br />
    //     <label for="password">Password:</label>
    //     <input id="login-box" type="password" name="password" required></input>
    //     <br />
    //     <label for="name">Full Name:</label>
    //     <input
    //       id="login-box"
    //       type="text"
    //       name="name"
    //       placeholder="ex. John Doe"
    //       required
    //     ></input>
    //     <br />
    //     <label for="occupation">Company/School: </label>
    //     <input id="login-box" type="text" name="occupation" required></input>
    //     <br />

    //     <label for="email">Email: </label>
    //     <input
    //       id="login-box"
    //       type="email"
    //       name="email"
    //       placeholder="ex. john.doe@email.com"
    //       required
    //     ></input>
    //     <br />
    //     <label for="phoneNumber">Phone: </label>
    //     <InputMask
    //       id="login-box"
    //       type="tel"
    //       name="phoneNumber"
    //       mask="(999) 999-9999"
    //       placeholder="ex. (123) 456-7890"
    //       required
    //     ></InputMask>
    //     <br />
    //     <label for="address">Address: </label>
    //     <input id="login-box" type="address" name="address" required></input>
    //     <br />
    //     <input type="submit" value="Sign Up"></input>
    //   </form>
    // </div>
  );
}
